import { Button, Dialog, DialogContent, DialogTitle, TextField, Typography, CardMedia, DialogActions, FormLabel, FormControl } from "@mui/material";
import { Box } from "@mui/system";
import { useState } from "react";
import "./style.css"

export default function CryptoBlock(props) {

  const [open, setOpen] = useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const handelChange = (e) => {
    props.value(e.target.value, props.item.name);
  };

  return (
    <>
      <Box key={props.key} className="content" sx={{ display: 'flex', justifyContent: 'space-between', alignItems:"center", mb: "10px", padding: "15px" }}>
        <Box sx={{ display: "flex" }}>
          <CardMedia
          sx={{pr:"10px"}}
            component="img"
            height="30"
            width="30"
            image={props.item.image}
            alt={props.item.name}
          />
          <Typography sx={{pt: "10px"}}>{props.item.name}</Typography>
        </Box>
        <Button variant="contained" onClick={handleClickOpen} >Buy</Button>
        <Dialog open={open} onClose={handleClose}>
          <DialogTitle>{props.item.name}</DialogTitle>
          <DialogContent>
            <TextField
              autoFocus
              margin="dense"
              id="name"
              label="Amount"
              type="number"
              fullWidth
              variant="standard"
              onChange={handelChange}
            />
          </DialogContent>
          <DialogActions>
            <Button onClick={handleClose}>Cancel</Button>
            <Button onClick={() => {
              // props.handleBuy();
              props.handleClose();
            }}>Buy</Button>
          </DialogActions>
        </Dialog>
      </Box>
    </>
  )
};
